import React from 'react';
import agent1 from './img/agent1.jpg';
import agent3 from './img/agent3.jpg';
import agent4 from './img/agent4.jpg';


function AllAgentsSidebar(props) {
    return (
        <div>
        <div className="all_agents_sidebar">
            <div className="all_agents_item">
                <div className="aai_img_container">
                    <a href="/AgentJohnProfile"><img src={props.agentSBImg} alt="" /></a>
                </div>
                <div className="aai_content">
                    <a href="/AgentJohnProfile" className="aai_name">{props.agentSBName}</a>
                    <a href="tel:1234561235" className="aai_phone">{props.agentSBPhone}</a>
                    <a href="/AgentJohnProfile" className="aai_button">View Profile</a>
                </div>
            </div>
            </div>
            
        </div>
    )
}

export default AllAgentsSidebar
